 fiis_financials_risk:
 freshness: { max_age_hours: 30 }
 not_null: [ticker]
 accepted_range:
 max_drawdown: { min: 0.0

fiis_financials_risk:
freshness: { max_age_hours: 30 }
not_null: [ticker]
accepted_range:
max_drawdown: { min: 0.0, max: 1.0 }
r_squared: { min: 0.0, max: 1.0 }

fiis_noticias:
freshness: { max_age_hours: 30 }
not_null: [ticker, title, url, published_at]

fiis_cadastro:
not_null: [ticker, fii_cnpj, display_name]

client_fiis_positions:
freshness: { max_age_minutes: 30 }
not_null: [document_number, position_date, ticker]

version: 20251108

window: "rolling"

planner:
 thresholds:
 defaults:
 # Padrão um pouco mais brando — usado só onde não há override
 min_score: 0.8
 min_gap: 0.10

 # Planner já está usando o gap "fused" (consolidado)
 apply_on: fused

 intents:
 # Rotas objetivas (alta precisão)
 fiis_cadastro: { min_score: 1.0, min_gap: 0.20 }
 fiis_precos: { min_score: 1.0, min_gap: 0.20 }
 fiis_dividendos: { min_score: 1.0, min_gap: 0.20 }
 fiis_rankings: { min_score: 1.0, min_gap: 0.20 }
 fiis_financials_snapshot: { min_score: 1.0, min_gap: 0.20 }

