 fiis_imoveis: { min_score: 0.8, min_gap: 0.10 }
 fiis_processos: { min_score: 0.8, min_gap: 0.10 }
 fiis_noticias: { min_score: 0.8, min_gap: 0.10 }
 fiis_financials_risk: { min_score: 0.8, min_gap: 0.00 }
